import '../linkedIn.css';
import '../linkedInFeed.css'
import '../icomoon/style.css'

function Main() {
    return (
        <div className="main">
            <div className="main__left">
                <div className="new-post-block margin-bottom_20">
                    <span className="new-post__title uppercase">new post</span>
                    <div className="new-post__input-block border-top">
                        <input type="text" placeholder="What's on your mind?" className="new-post__placeholder"/>
                        <img src="../images/paperclip.png" className="new-post__image"/>
                        <img src="../images/image.png" className="new-post__image"/>
                        <img src="../images/" className="new-post__image"/>
                    </div>
                </div>
            </div>
            <div className="main__right"></div>
        </div>
    );
}

export default Main;
